import {ADD_QUESTION, TEST_TITLE_HANDLER} from './actionTypes'

export function addQuestion(question) {
  return {
    type: ADD_QUESTION,
    question
  }
}

export function titleHandler(question) {
  return {
    type: TEST_TITLE_HANDLER,
    question
  }
}
